    false,nt"url": null,nt"notes": "NODC accession 0104370 includes physical
    and underway data collected aboard the THOMAS G. THOMPSON during cruise TN271 in
    the Coastal Waters of SE Alaska and North Pacific Ocean from 2011-09-01 to 2011-11-05.
    These data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
    COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
    These data were collected by Francois Ribalet of UNIVERSITY OF WASHINGTON as part
    of Transit/Distribution of Marine Microbes/Argo Floats. The Lamont-Doherty Earth
    Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling
    Deck to Repository (R2R) program. The ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
    accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
